import React, { ChangeEvent } from 'react';
import ReactTable, { Filter } from "react-table";
import "react-table/react-table.css";
// import { MapContainer } from './MapContainer';
import axios from 'axios';
import Modal from 'react-bootstrap/Modal';
import Tabs from 'react-bootstrap/Tabs'
import Tab from 'react-bootstrap/Tab'
import ReactPlayer from 'react-player';

import GoogleMapReact from 'google-map-react';

interface InternalState {
	data: any;
	popUp: boolean;
	mapData: any;
	video: any;
	videoUrl: string;
	playing: boolean;
	errorMessage: string;
	errorState: boolean;
}

interface Props {
	google: any;
}

class Home extends React.Component<Props, InternalState> {

	constructor(props: Props) {
		super(props);

		this.state = {
			data: [],
			popUp: false,
			mapData: {},
			video: {},
			videoUrl: '',
			playing: false,
			errorMessage: '',
			errorState: false
		}

		this.filterTable = this.filterTable.bind(this);
		this.imageClicked = this.imageClicked.bind(this);
		this.closeButton = this.closeButton.bind(this);
		this.playError = this.playError.bind(this);
		this.renderMarkers = this.renderMarkers.bind(this);
	}

	static defaultProps = {
		center: {
		lat: 59.95,
		lng: 30.33
		},
		zoom: 11
	};

	onPlay = () => {
		this.setState({ playing: true })
	}

	playError = (error: any) => {
		this.setState({
			errorMessage :'No video to display',
			errorState: true
		})
	}

	renderMarkers(map: any, maps: any) {
		const myLatLng = {
			lat: this.state.mapData.latitude,
			lng: this.state.mapData.longitude
		}
		let marker = new maps.Marker({
			position: myLatLng,
			map,
			title: 'Accident Site!!!',
			// animation: maps.Animation.BOUNCE
		});
		marker.setMap(map);
		map.setCenter(myLatLng);
	}

    render(){

		const columns = [
			{
				Header: 'Vehicle Name',
				accessor: 'vehicleName'
			}, {
				Header: 'VIN',
				accessor: 'vin',
				Cell: (props: any) => <span className='number'>{props.value}</span>
			}, {
				id: 'accident',
				Header: 'Accident Date',
				accessor: (d: any) => d.accident
			}, {
				Header: (props: any) => <span>Action</span>,
				accessor: 'vin',
				Cell: (props: any) => <span><img onClick={() => this.imageClicked(props.value)} height="40" width="40" src="data:image/png;base64," alt=""/></span>
			}
		];

		const Marker = (props: any) => {
			return (
			<React.Fragment>
				<div className="pin" />
				<div className='pulse'></div>
			</React.Fragment>
			);
		}

		
        return(
			<React.Fragment>
				<div className={'encloser'}>
					
					
					 <ReactTable
						noDataText="No Accidents"
						data={this.state.data}
						filterable
						defaultFilterMethod={this.filterTable}
						columns={columns}
						defaultPageSize={5}
						className="-striped -highlight"
					/>
					<br />

					<Modal 
						show= {this.state.popUp} 
						onHide={this.closeButton}
						size="xl"
        				aria-labelledby="contained-modal-title-vcenter"
						dialogClassName='custom-dialog'
					>
						<Modal.Header closeButton>
							<Modal.Title>Vehicle Details</Modal.Title>
						</Modal.Header>

						<Modal.Body>
							<Tabs defaultActiveKey="location" id="tabs">
								<Tab eventKey="location" title="Location">
									<div style={{height: '40vw', paddingTop: '20px'}}>
										<GoogleMapReact
											style={{height: '400px'}}
											bootstrapURLKeys={{key:'AIzaSyCm_W5Ft1HW1VOhqx-hOTSAN9n8Ryh75L8'}}
											defaultZoom={0}
											yesIWantToUseGoogleMapApiInternals
											center={{lat: 12.97, lng: 77.59}}
											resetBoundsOnResize = {true}
											onGoogleApiLoaded={({map, maps}) => this.renderMarkers(map, maps)}
										>
											{false && <Marker lat={12.97} lng={77.59}/>}
										</GoogleMapReact>	
									</div>
								</Tab>
								<Tab eventKey="video" title="Video">
									<div style={{height: '40vw', paddingTop: '20px'}}>
										<br/>
										{ !this.state.errorState && 
										<ReactPlayer
											url={this.state.videoUrl}
											className='react-player'
											playing = {false}
											controls
											width='450px'
											height='400px'
											onError={this.playError}
										/>
										}
										{ this.state.errorState && 
											<span>{this.state.errorMessage}</span>
										}
									</div>	
								</Tab>
							</Tabs>
						</Modal.Body>
					</Modal>
				</div>
			</React.Fragment>
        );
	}
	// "https://media.w3.org/2010/05/sintel/trailer_hd.mp4"
	
	public filterTable(filter: Filter, row: any) {
		return String(row[filter.id]).indexOf(filter.value) > -1;
	}

	public imageClicked(vin: string) {

		// filter out the vehicle data from the vehicles
        const vehicleData = this.state.data.filter((element: any) => element.vin === vin)

		this.setState({
			popUp: true,
			mapData: vehicleData[0].location,
			videoUrl: vehicleData[0].videoUrl
		});
	}


	public closeButton() {
		this.setState({
			popUp: false,
			videoUrl: ''
		});
	}
	public componentDidMount() {
		
		axios.get('https://myapp-2.azurewebsites.net/listAll')
             .then( (response: any) => {
				 this.setState({
					data: response.data

				})
			})
			 .catch((error: any) => {
				 console.log('error occured');
			 });

	}

}

export default Home;
